							<div class="otzivi-card__body-descp">
								Работала с этой компанией, помогали с оформлением бани. Созвонилась с менеджером, через пару часов приехал замерщик, с ним обсудили что и как. 
								После менеджер помог выбрать материал, остановились на дубе - для пола и сосна- для стен. Через неделю всё доставили, в хорошем состоянии, 
								выбрала сразу с покраской. Цены хорошие, персонал вежливый и приятный.
							</div>
